using System.Reflection;
using System.Text;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

namespace DocTemplateTool.Pdf.Test
{
    [TestClass]
    public class UnitTest3
    {


        private static readonly string templatePath_Doc = Path.Combine(new FileInfo(Assembly.GetExecutingAssembly().Location).Directory.FullName, "Assets");

        private static readonly string outputPath_Doc = new FileInfo(Assembly.GetExecutingAssembly().Location).Directory.FullName;



        /// <summary>
        /// 测试：从不同图片来源生成文档
        /// </summary>
        [TestMethod]
        public void TestFromDynamicObject()
        {
            byte[] docFileContent;

            var docinfo = new
            {
                //本地图片
                GraphicFromLocal = Path.Combine(new FileInfo(Assembly.GetExecutingAssembly().Location).Directory.FullName, "Assets", $"TestPicture.jpeg"),
                //网络图片
                GraphicFromUrl = "https://fuss10.elemecdn.com/e/5d/4a731a90594a4af544c0c25941171jpeg.jpeg",
                //Base64编码图片
                GraphicFromBase64 = @"data:image/jpeg;base64,",
            };
            var ext = ".docx";
            var result = Exporter.ExportDocxByObject(Path.Combine(templatePath_Doc, $"PictureTemplate.docx"), docinfo, (s) => s);

            using (var memoryStream = new MemoryStream())
            {
                result.Write(memoryStream);
                memoryStream.Seek(0, SeekOrigin.Begin);
                docFileContent = memoryStream.ToArray();
            }
            File.WriteAllBytes(Path.Combine(outputPath_Doc, $"Picture.docx"), docFileContent);

        }



    }



}